import React, { useState, useRef } from "react";
import axios from "axios";
import Webcam from "react-webcam";
import { FaPlay, FaPause, FaStepBackward, FaStepForward } from "react-icons/fa";

const App = () => {
  const [text, setText] = useState("");
  const [emotion, setEmotion] = useState("");
  const [songs, setSongs] = useState([]);
  const [loading, setLoading] = useState(false);
  const [webcamActive, setWebcamActive] = useState(false);
  const webcamRef = useRef(null);

  const analyzeText = async () => {
    setLoading(true);
    setEmotion("");
    setSongs([]);
    try {
      const res = await axios.post("http://localhost:5000/text-emotion", { text });
      setEmotion(res.data.emotion);
      setSongs(res.data.songs || []);
    } catch (error) {
      setEmotion("neutral");
      setSongs([]);
    }
    setLoading(false);
  };

  return (
    <div className="flex h-screen bg-gray-900 text-white">
      {/* Sidebar */}
      <aside className="w-1/5 p-5 bg-gray-800">
        <h2 className="text-xl font-bold">Feelin' Flow</h2>
        <nav className="mt-5">
          <ul>
            <li className="py-2">Home</li>
            <li className="py-2 bg-orange-500 rounded-md">Albums</li>
            <li className="py-2">Tracks</li>
            <li className="py-2">Genres</li>
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="flex-1 p-5 overflow-y-auto">
        <h1 className="text-3xl font-bold mb-5">Discover Music by Mood</h1>
        <div className="flex gap-5">
          <input 
            type="text" 
            placeholder="How are you feeling?" 
            className="p-3 w-full rounded-md text-black" 
            value={text} 
            onChange={(e) => setText(e.target.value)} 
          />
          <button onClick={analyzeText} className="px-5 py-2 bg-orange-500 rounded-md">Analyze</button>
        </div>
        {loading && <p className="mt-3">Analyzing...</p>}
        {emotion && <p className="mt-3">Detected Emotion: <strong>{emotion}</strong></p>}

        <div className="grid grid-cols-3 gap-5 mt-5">
          {songs.map((song, index) => (
            <div key={index} className="bg-gray-700 p-3 rounded-md">
              <img src={song.album_image} alt={song.name} className="w-full h-40 object-cover rounded-md" />
              <p className="mt-2 font-semibold">{song.name}</p>
              <p className="text-sm">{song.artist}</p>
            </div>
          ))}
        </div>
      </main>

      {/* Right Panel */}
      <aside className="w-1/4 p-5 bg-gray-800">
        <h2 className="text-xl font-bold mb-3">Now Playing</h2>
        <div className="bg-gray-700 p-3 rounded-md">
          <p className="font-semibold">Lady Magnolia</p>
          <p className="text-sm">Piero Umiliani</p>
        </div>
      </aside>

      {/* Bottom Music Player */}
      <footer className="fixed bottom-0 w-full p-3 bg-gray-800 flex items-center justify-between">
        <button><FaStepBackward /></button>
        <button><FaPlay /></button>
        <button><FaStepForward /></button>
      </footer>
    </div>
  );
};

export default App;
